import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    
    <>
    <link rel="stylesheet" href="style.css"></link>
      <nav>
        <ul class="">
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/calculator">Schadensrechner</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
        
        </ul>
      </nav>

      <Outlet />
    </>
  )
};

export default Layout;
